import React, { Component } from 'react'
import { Col } from 'react-bootstrap'

export default class ListCategori extends Component {
    constructor(props) {
      super(props)
    
      this.state = {
         categories : [],
      }
    }

      
  render() {
    return (
        <Col md={3} mt="2">
            <h4><strong>List Category</strong></h4>
        <hr />
        
       </Col>
    )
  }
}
